import React, { Component } from 'react';
import { Table } from 'reactstrap';
import axios from 'axios';

class TableComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: [],
        };
      }

    componentDidMount() {
        axios.get(`http://localhost:8000/api/deliveries.php`)
            .then(
                res => {
                    this.setState ({
                        id: res.data
